Littérateurs et Poètes : Jacques Amyot, pièce curieuse
comme évêque d’Auxerre; Jean de Barclay, poète lorrain, dont
les autographes sont peu communs; Bayle; Beaumarchais;
Claude Binet, l’ami de Ronsard, et aussi rare que lui ;
Bolingbroke; le père Bouhours; Claude Brossette, dont le nom
se trouve lié à celui de Boileau, son ami; Des Yveteaux, une
rareté, même comme simple signature; Diderot; Jean Dorat,
poète de la Pléiade; Florian ; l’abbé Grécourt, autographe rare;
Helvétius-, La Fontaine; Pierre de l’Estoille, l’historien;
François Malherbe; Sylvain Maréchal ; Maucroix, une lettre
à Boileau et fort rare ; Louis Racine ; Régnard; Saint-Evremont;
Saint-Simon, l’auteur des Mémoires ; Vauvenargues, etc. —
N’oublions pas dans les modernes une lettre bien curieuse de
Jules Janin sur son procès avec Félix Pyat.

Souverains et Princes : Alphonse II, roi de Naples;
Charles Vilet Charles VIII ; Louis XI, Louis XII et Louis XV;
Louis XIV est représenté par une lettre historique des plus
remarquables adressée à Catinat, et qui n’a pas moins de 3 pages
in-fol. — Marie Stuart, belle pièce sig. ; Marie Leczinska et
Marie-Antoinette.
